const bgColors = {
    'primary': '#A897E2',
    'secondary': '#504A66',
    'dark': '#181818',
    'altdark': '#444',
    'bdark': '#222',
};

function updateCSSRule(selector, property, value) {
    // Loop through all the style sheets
    for (let i = 0; i < document.styleSheets.length; i++) {
        const sheet = document.styleSheets[i];
        try {
            const rules = sheet.cssRules || sheet.rules;
            for (let j = 0; j < rules.length; j++) {
                const rule = rules[j];
                if (rule.selectorText === selector) {
                    rule.style[property] = value;
                    return;
                }
            }
        } catch (e) { }
    }
    const styleSheet = document.styleSheets[0] || createStyleSheet();
    styleSheet.insertRule(`${selector} { ${property}: ${value}; }`, styleSheet.cssRules.length);
}

function createStyleSheet() {
    const style = document.createElement('style');
    document.head.appendChild(style);
    return style.sheet;
}

function setRandomBackground() {
    Object.keys(bgColors).forEach((key) => {
        const randomIndex = Math.floor(Math.random() * svgs.length);
        let randomSvg = svgs[randomIndex]; // Changed 'const' to 'let' here

        // Darken the background color by 5% for the SVG stroke color
        const darkerColor = darkenColor(bgColors[key], 5);

        // First replace colors in style tags
        randomSvg = randomSvg.replace(/<style type="text\/css">([^<]+)<\/style>/g, function (match, group) {
            return `<style type="text/css">${group.replace(/stroke:#000/g, `stroke:${darkerColor}`)}</style>`;
        });

        // Then replace colors in inline style attributes
        randomSvg = randomSvg.replace(/style="([^"]+)"/g, function (match, group) {
            return `style="${group.replace(/stroke:#000/g, `stroke:${darkerColor}`)}"`;
        });

        // Apply the SVG as the background image
        updateCSSRule(`.bg-${key}`, 'backgroundImage', `url('data:image/svg+xml,${encodeURIComponent(randomSvg)}')`);
    });
}

function darkenColor(hexColor, percent) {
    if (hexColor.length === 4) { // Convert shorthand hex color to full form
        hexColor = '#' + hexColor[1] + hexColor[1] + hexColor[2] + hexColor[2] + hexColor[3] + hexColor[3];
    }

    const num = parseInt(hexColor.slice(1), 16),
        amt = Math.round(2.55 * percent),
        R = (num >> 16) - amt,
        G = (num >> 8 & 0x00FF) - amt,
        B = (num & 0x0000FF) - amt;

    return "#" + (0x1000000 + (R < 255 ? R < 1 ? 0 : R : 255) * 0x10000 + (G < 255 ? G < 1 ? 0 : G : 255) * 0x100 + (B < 255 ? B < 1 ? 0 : B : 255)).toString(16).slice(1);
}

