function findEntryByCodename(gameTitle, codename) {
    if (codename.endsWith('_mp')) {
        codename = codename.slice(0, -3);
    }

    for (const category in gameData) {
        if (gameData.hasOwnProperty(category)) {
            const entries = gameData[category];

            // Assuming entries is an array of objects
            const entry = entries.find(item => item.codename === codename && (!item.game || item.game.includes(gameTitle)));

            if (entry) {
                return entry;
            }
        }
    }
    // Return a default object if no entry is found
    return { 'codename': codename, 'realName': codename };
}

