// Convert a hex color to an RGB object
function hexToRgb(hex) {
    var result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
    return result ? {
        r: parseInt(result[1], 16),
        g: parseInt(result[2], 16),
        b: parseInt(result[3], 16)
    } : null;
}

// Interpolate between two colors and generate `steps` colors between them
function interpolateColors(color1, color2, steps) {
    let stepFactor = 1 / (steps - 1),
        interpolatedColorArray = [];

    color1 = hexToRgb(color1);
    color2 = hexToRgb(color2);

    for (let i = 0; i < steps; i++) {
        interpolatedColorArray.push(interpolateColor(color1, color2, stepFactor * i));
    }

    // Convert RGB objects to hex strings
    return interpolatedColorArray.map(rgb => {
        return `#${((1 << 24) + (rgb.r << 16) + (rgb.g << 8) + rgb.b).toString(16).slice(1)}`;
    });
}

// Interpolate two colors
function interpolateColor(color1, color2, factor) {
    if (factor < 0) factor = 0;
    if (factor > 1) factor = 1;

    let result = color1.r + factor * (color2.r - color1.r),
        g = color1.g + factor * (color2.g - color1.g),
        b = color1.b + factor * (color2.b - color1.b);

    return { r: Math.round(result), g: Math.round(g), b: Math.round(b) };
}

function formatTime(secondsString) {
    const seconds = parseInt(secondsString, 10); // Convert string to a number

    const days = Math.floor(seconds / (3600 * 24));
    const hours = Math.floor((seconds % (3600 * 24)) / 3600);
    const minutes = Math.floor((seconds % 3600) / 60);

    // Building the output string
    let timeString = '';

    if (days > 0) timeString += days + (days === 1 ? ' day ' : ' days ');
    if (hours > 0 || days > 0) timeString += hours + (hours === 1 ? ' hour ' : ' hours ');
    if (minutes > 0 || hours > 0 || days > 0) timeString += minutes + (minutes === 1 ? ' minute' : ' mins');

    return timeString.trim();
}

