function displayMatchDetailsModal(matchData) {
    // Create the modal element
    const modal = document.createElement('div');
    modal.className = 'modal fade'; // Use Bootstrap's modal and fade classes
    modal.setAttribute('tabindex', '-1');
    modal.setAttribute('role', 'dialog');

    // Modal dialog
    const modalDialog = document.createElement('div');
    modalDialog.className = 'modal-dialog modal-xl';
    modalDialog.setAttribute('role', 'document');
    modal.appendChild(modalDialog);

    // Modal content
    const modalContent = document.createElement('div');
    modalContent.className = 'modal-content bg-dark text-white';
    modalDialog.appendChild(modalContent);

    // Modal header
    const modalHeader = document.createElement('div');
    modalHeader.className = 'modal-header';
    modalHeader.style.borderBottom = 'none';
    modalContent.appendChild(modalHeader);

    // Create hyperlink element for the modal title
    const modalTitleLink = document.createElement('a');
    modalTitleLink.href = `../${matchData.matchId}`; // Set the href to the match details page
    modalTitleLink.className = 'modal-title h3';
    modalTitleLink.textContent = 'Match Details';
    modalTitleLink.style.textDecoration = 'none'; // Optional: Removes underline from hyperlink
    modalHeader.appendChild(modalTitleLink);

    const closeButton = document.createElement('button');
    closeButton.className = 'close';
    closeButton.setAttribute('data-dismiss', 'modal');
    closeButton.setAttribute('aria-label', 'Close');
    closeButton.innerHTML = '<i class="fas fa-times" style="color: red;"></i>';
    modalHeader.appendChild(closeButton);

    // Modal body
    const modalBody = document.createElement('div');
    modalBody.className = 'modal-body pt-0';
    modalContent.appendChild(modalBody);

    // Group players by team
    const teams = matchData.players.reduce((acc, player) => {
        acc[player.team] = acc[player.team] || [];
        acc[player.team].push(player);
        return acc;
    }, {});

    // Create tables for each team
    for (const [teamName, players] of Object.entries(teams)) {
        const teamSection = document.createElement('section');
        teamSection.className = 'team-section';

        let scoreOrPlacement;
        if (teamName.toLowerCase().includes('allies')) {
            scoreOrPlacement = matchData.alliesScore;
            captionVar = 'Score: '
        } else if (teamName.toLowerCase().includes('axis')) {
            scoreOrPlacement = matchData.axisScore;
            captionVar = 'Score: '
        } else {
            scoreOrPlacement = players[0].placement;
            captionVar = ''
        }

        const teamTitle = document.createElement('h3');
        teamTitle.style.display = 'flex'; // Use flexbox for alignment
        teamTitle.style.justifyContent = 'space-between'; // Space between team name and score or placement
        teamTitle.style.alignItems = 'center'; // Center items vertically
        teamTitle.style.paddingLeft = '.5rem'
        teamTitle.style.paddingRight = '.5rem'
        teamTitle.innerHTML = `<span>${teamName.toProperCase()}</span> <span>${captionVar}${scoreOrPlacement}</span>`;
        teamSection.appendChild(teamTitle);

        // Create a responsive table container
        const tableResponsive = document.createElement('div');
        tableResponsive.className = 'table-responsive';

        const table = document.createElement('table');
        table.className = 'table table-dark';
        tableResponsive.appendChild(table);

        const thead = document.createElement('thead');
        table.appendChild(thead);

        const trHead = document.createElement('tr');
        thead.appendChild(trHead);

        const statsPresence = {
            assists: false,
            headshots: false,
            damage: false,
            longestStreak: false,
            score: false,
            scorePerMinute: false
        };

        // Check all players to see which stats are present
        matchData.players.forEach(player => {
            if (player.playerStats) {
                statsPresence.assists = statsPresence.assists || 'assists' in player.playerStats;
                statsPresence.headshots = statsPresence.headshots || 'headshots' in player.playerStats;
                statsPresence.longestStreak = statsPresence.longestStreak || 'longestStreak' in player.playerStats;
                statsPresence.scorePerMinute = statsPresence.scorePerMinute || 'scorePerMinute' in player.playerStats;
            }
            statsPresence.damage = statsPresence.damage || 'damage' in player;
            statsPresence.score = statsPresence.score || 'score' in player;
        });

        // Generate the headers based on the statsPresence
        const headers = [
            '', 'Username', 'Kills', 'Deaths', 'KD',
            statsPresence.assists ? 'Assists' : null,
            statsPresence.headshots ? 'Headshots' : null,
            statsPresence.damage ? 'DMG' : null,
            statsPresence.longestStreak ? 'Streak' : null,
            statsPresence.score ? 'Score' : null,
            statsPresence.scorePerMinute ? 'SPM' : null
        ].filter(h => h !== null);

        headers.forEach(header => {
            const th = document.createElement('th');
            th.textContent = header;
            trHead.appendChild(th);
        });

        const tbody = document.createElement('tbody');
        table.appendChild(tbody);

        // Create player rows and weapon stats rows
        players.forEach(player => {
            const tr = document.createElement('tr');
            tbody.appendChild(tr);

            // New table cell for weapon details button
            const tdWeaponButton = document.createElement('td');
            tdWeaponButton.style.textAlign = 'center';
            const weaponButton = document.createElement('button');
            weaponButton.className = 'btn btn-circle bg-primary';
            weaponButton.style.padding = '0px';  // Smaller padding for the button
            weaponButton.style.width = '20px';  // Smaller width for the button
            weaponButton.style.height = '20px';  // Smaller width for the button
            weaponButton.style.fontSize = 'small';  // Smaller width for the button
            weaponButton.style.display = 'inline-flex'; // Use flexbox for centering content
            weaponButton.style.alignItems = 'center'; // Center align vertically
            weaponButton.style.justifyContent = 'center'; // Center align horizontally
            weaponButton.innerHTML = '<i class="fa-solid fa-gun"></i>';  // Font Awesome 'bomb' glyph
            tdWeaponButton.appendChild(weaponButton);
            tr.appendChild(tdWeaponButton);

            const kills = player.kills ?? '';
            const deathsExist = player.hasOwnProperty('playerStats'); // Check if the 'playerStats' property exists
            const deaths = deathsExist && typeof player.playerStats.deaths === 'number' ? player.playerStats.deaths : '';
            const kdRatio = deaths !== '' && kills !== '' && deaths > 0 ? (kills / deaths).toFixed(2) : '';

            const playerData = [
                { value: player.username },
                { value: kills.toString() }, // We've already calculated kills above
                { value: deathsExist ? deaths.toString() : '' }, // Use deathsExist to decide the value
                { value: kdRatio }, // We've already calculated kdRatio above
                statsPresence.assists ? { value: player.playerStats?.assists?.toString() ?? '' } : null,
                statsPresence.headshots ? { value: player.playerStats?.headshots?.toString() ?? '' } : null,
                statsPresence.damage ? { value: player.damage?.toString() ?? '' } : null,
                statsPresence.longestStreak ? { value: player.playerStats?.longestStreak?.toString() ?? '' } : null,
                statsPresence.score ? { value: player.score?.toString() ?? '' } : null,
                statsPresence.scorePerMinute ? { value: player.playerStats?.scorePerMinute?.toString() ?? '' } : null
            ].filter(pd => pd !== null); // We're now making sure to filter out any null values

            playerData.forEach(data => {
                const td = document.createElement('td');
                td.textContent = data.value; // Now, data is guaranteed to be an object, not null
                tr.appendChild(td);
            });

            // Drill-down row for weapon stats, initially hidden
            const trDrillDown = document.createElement('tr');
            trDrillDown.className = 'weapon-stats d-none';
            tbody.appendChild(trDrillDown);

            const tdDrillDown = document.createElement('td');
            tdDrillDown.colSpan = headers.length;
            trDrillDown.appendChild(tdDrillDown);

            // Placeholder text
            tdDrillDown.textContent = 'Loading weapon stats...';

            // Click event to load and show weapon stats
            tr.addEventListener('click', function () {
                // Toggle showing the weapon stats
                $(trDrillDown).toggleClass('d-none');
                if (!trDrillDown.classList.contains('d-none') && !trDrillDown.dataset.loaded) {
                    // Clear placeholder text and load weapon stats
                    tdDrillDown.textContent = '';
                    const listGroup = document.createElement('div');
                    listGroup.className = 'd-flex flex-row flex-nowrap overflow-auto bg-primary';

                    const aggregatedWeaponStats = {};

                    if (player.hasOwnProperty('weaponStats')) {
                        player.weaponStats.forEach(weapon => {
                            if (weapon.name.toLowerCase() !== 'none' && weapon.damage !== 0) {
                                // Find the real name of the weapon
                                const realName = findEntryByCodename('', weapon.name).realName;

                                // If the weapon with this real name hasn't been added to the aggregation, initialize it
                                if (!aggregatedWeaponStats[realName]) {
                                    aggregatedWeaponStats[realName] = {
                                        kills: 0,
                                        deaths: 0,
                                        damage: 0,
                                        headshots: 0,
                                        shots: 0,
                                        hits: 0
                                    };
                                }

                                // Aggregate the stats
                                aggregatedWeaponStats[realName].kills += weapon.kills;
                                aggregatedWeaponStats[realName].deaths += weapon.deaths;
                                aggregatedWeaponStats[realName].damage += weapon.damage;
                                aggregatedWeaponStats[realName].headshots += weapon.headshots;
                                aggregatedWeaponStats[realName].shots += weapon.shots;
                                aggregatedWeaponStats[realName].hits += (weapon.hits || weapon.kills); // Using kills if hits is 0
                            }
                        });

                    }

                    // Now create list items with the aggregated stats
                    Object.keys(aggregatedWeaponStats).forEach(weaponName => {
                        const weapon = aggregatedWeaponStats[weaponName];
                        const accuracy = weapon.shots > 0 ? (weapon.hits / weapon.shots * 100).toFixed(2) : 'N/A';

                        const listItem = document.createElement('div');
                        listItem.className = 'p-2'; // Bootstrap padding class, adjust as needed
                        listItem.innerHTML = `
                            <strong>${weaponName}</strong><br>
                            Kills: ${weapon.kills}<br>
                            Deaths: ${weapon.deaths}<br>
                            Damage: ${weapon.damage}<br>
                            Headshots: ${weapon.headshots}<br>
                            Accuracy: ${accuracy}%`;
                        listGroup.appendChild(listItem);
                    });
                    tdDrillDown.appendChild(listGroup);
                    trDrillDown.dataset.loaded = 'true'; // Mark as loaded
                }
            });
        });

        teamSection.appendChild(tableResponsive);
        modalBody.appendChild(teamSection);
    }

    // Append modal to the body
    document.body.appendChild(modal);

    // Use Bootstrap's JavaScript to show the modal
    $(modal).modal('show');
}

